export const enrichedTitleViewPipeline = [
    {
        "$addFields": {
            "enriched_title": {
                $concat: [{$toString: "$_id"}, " - ", "$title", " (", {$arrayElemAt: ["$genres", 0]}, ")"],
            },
        },
    },
];

export const actionMoviesViewPipeline = [{"$match": {"$expr": {"$in": ["Action", "$genres"]}}}];

/**
 * @returns An array of movie documents with an additional field as specified in
 *     enrichedTitleViewPipeline above.
 */
export function getMovieDataWithEnrichedTitle() {
    const data = getMovieData();
    data.map((movie) => {
        movie.enriched_title = movie._id + " - " + movie.title + " (" + movie.genres[0] + ")";
    });
    return data;
}

/**
 * @param {Object} viewType - The type of view to create, as specified from the datasets object in
 *     search_e2e_utils.js.
 * @returns A view of the movies collection based on the specified viewType.
 */
export function createMoviesView(viewType) {
    const testDb = db.getSiblingDB("vector_search_shared_db");
    const coll = testDb.moviesColl;

    // Populate the collection.
    if (coll.count() === 0) {
        assert.commandWorked(coll.insertMany(getMovieData()));
    }

    const viewName = viewType.viewName;

    // Check if the view exists using collection metadata.
    const viewExists = testDb.getCollectionInfos({name: viewName, type: "view"}).length > 0;
    if (!viewExists) {
        // Create the view if it doesn't exist.
        if (viewType === datasets.MOVIES_WITH_ENRICHED_TITLE) {
            assert.commandWorked(testDb.createView(viewName, coll.getName(), enrichedTitleViewPipeline));
        } else if (viewType === datasets.ACTION_MOVIES) {
            assert.commandWorked(testDb.createView(viewName, coll.getName(), actionMoviesViewPipeline));
        } else if (viewType == datasets.ACTION_MOVIES_WITH_ENRICHED_TITLE) {
            // Nested view.
            const view = createMoviesView(datasets.MOVIES_WITH_ENRICHED_TITLE);
            assert.commandWorked(testDb.createView(viewName, view.getName(), actionMoviesViewPipeline));
        }
    }

    return testDb[viewName];
}

/**
 * @returns The movies collection.
 */
export function createMoviesColl() {
    const testDb = db.getSiblingDB("vector_search_shared_db");
    const coll = testDb.moviesColl;

    // Populate the collection.
    if (coll.count() === 0) {
        assert.commandWorked(coll.insertMany(getMovieData()));
    }

    return coll;
}

/**
 * @returns The movies collection with a vector search index on the plot_embedding field.
 */
export function createMoviesCollAndVectorIndex() {
    const coll = createMoviesColl();

    // Create an index if it doesn't already exist.
    if (!checkForExistingIndex(coll, datasets.MOVIES.indexName)) {
        createSearchIndex(coll, getMovieVectorSearchIndexSpec({indexName: datasets.MOVIES.indexName}));
    }

    return coll;
}

/**
 * @returns The movies collection with a vector search index on the plot_embedding field and a
 * search index.
 */
export function createMoviesCollWithSearchAndVectorIndex() {
    const coll = createMoviesColl();

    // Create a vector index if it doesn't already exist.
    if (!checkForExistingIndex(coll, defaultVectorIndexName)) {
        createSearchIndex(coll, getMovieVectorSearchIndexSpec());
    }

    // Create a search index if it doesn't already exist.
    if (!checkForExistingIndex(coll, defaultSearchIndexName)) {
        createSearchIndex(coll, getMovieSearchIndexSpec());
    }

    return coll;
}

/**
 * @param {Object} viewType - The type of view to create, as specified from the datasets object in
 *     search_e2e_utils.js.
 * @returns The movies view with a vector search index on the plot_embedding field.
 */
export function createMoviesViewAndIndex(viewType) {
    const view = createMoviesView(viewType);

    if (!checkForExistingIndex(view, viewType.indexName)) {
        createSearchIndex(view, getMovieVectorSearchIndexSpec({indexName: viewType.indexName}));
    }

    return view;
}

/**
 * @param {Array} queryVector - A plot embedding to vector search upon
 * @param {number} limit - The maximum number of results to return.
 * @param {string} indexName - The name of the vector search index to use.
 * @returns A vector search query on the index specified with exact: true.
 */
export function makeMovieVectorExactQuery({queryVector, limit, indexName = defaultVectorIndexName}) {
    return {
        $vectorSearch: {
            queryVector: queryVector,
            path: "plot_embedding",
            exact: true,
            index: indexName,
            limit: limit,
        },
    };
}

/**
 * @param {Array} queryVector - A plot embedding to vector search upon
 * @param {number} limit - The maximum number of results to return.
 * @param {string} indexName - The name of the vector search index to use.
 * @param {number} numCandidates - The number of nearest neighbors to consider.
 * @returns A vector search query on the index specified with the specified numCandidates.
 */
export function makeMovieVectorCandidatesQuery({
    queryVector,
    limit,
    numCandidates,
    indexName = defaultVectorIndexName,
}) {
    return {
        $vectorSearch: {
            queryVector: queryVector,
            path: "plot_embedding",
            numCandidates: numCandidates,
            index: indexName,
            limit: limit,
        },
    };
}

/**
 * @param {string} queryString - The search query string to use.
 * @param {boolean} scoreDetails - Whether to include score details in the results.
 * @param {string} indexName - The name of the search index to use.
 * @returns A search query on the specified index.
 */
export function makeMovieSearchQuery({queryString, scoreDetails, indexName = defaultSearchIndexName}) {
    return {
        $search: {
            index: indexName,
            text: {query: queryString, path: ["fullplot", "title"]},
            scoreDetails: scoreDetails,
        },
    };
}

/**
 * @param {string} indexName - The name of the vector search index to generate a spec for.
 * @param {list} filterFields - Additional fields to include in the index definition to support
 *     pre-filtering.
 * @returns A vector search index spec on the plot_embedding field.
 */
export function getMovieVectorSearchIndexSpec({indexName = defaultVectorIndexName, filterFields = []} = {}) {
    const fields = [
        {
            "type": "vector",
            "numDimensions": 1536,
            "path": "plot_embedding",
            "similarity": "euclidean",
        },
    ].concat(filterFields);

    return {name: indexName, type: "vectorSearch", definition: {"fields": fields}};
}

export function getMovieSearchIndexSpec() {
    return {name: defaultSearchIndexName, definition: {"mappings": {"dynamic": true}}};
}

/**
 * @param id of a movie document.
 * @returns The corresponding plot embedding.
 */
export function getMoviePlotEmbeddingById(id) {
    return plotEmbeddings[id];
}

/**
 * Drops the default vector search and search indexes on the movies collection.
 */
export function dropDefaultMovieSearchAndOrVectorIndexes() {
    const testDb = db.getSiblingDB("vector_search_shared_db");
    const coll = testDb.moviesColl;

    // Drop the vector index if it exists.
    if (checkForExistingIndex(coll, defaultVectorIndexName)) {
        dropSearchIndex(coll, {name: defaultVectorIndexName});
    }

    // Drop the search index if it exists.
    if (checkForExistingIndex(coll, defaultSearchIndexName)) {
        dropSearchIndex(coll, {name: defaultSearchIndexName});
    }
}
